import React from "react";
import MovieDetails from "./components/MovieDetails.jsx";

function App() {
  const favoriteMovie = {
    title: "Inception",
    director: "Christopher Nolan",
    year: 2010,
    studio: "Warner Bros.",
    poster: "https://example.com/inception-poster.jpg",
  };

  return (
    <div>
      <h1>Улюблений фільм</h1>
      <MovieDetails movie={favoriteMovie} />
    </div>
  );
}

export default App;
